import React from "react";

import "./SideBar.css";

import {VscMenu, VscFiles, VscSearch} from "react-icons/vsc";

function SideBar() {
    return (<div className="left-bar">
        <div className="left-bar-item">
            <div className="left-bar-icon" style={{fontSize: "1.1rem", height: "35px"}}>
                <VscMenu/>
            </div>
        </div>
        <div className="left-bar-item">
            <div className="left-bar-icon">
                <VscFiles/>
            </div>
        </div>
        <div className="left-bar-item">
            <div className="left-bar-icon">
                <VscSearch/>
            </div>
        </div>
    </div>);
}

export default SideBar;
